import React from "react";
import { Link } from "react-router-dom";

const Movielist = ({ movies }) => {
  return (
    <div className="moviesList">
      {movies.map((movie) => (
        <div className="movie">
          <img key={movie.id} src={movie.imageUrl} alt={movie.title} />
          <h3>{movie.title}</h3>
        </div>
      ))}
    </div>
  );
};

export default Movielist;
